'use strict';
//@@DocBrief("Provides access to price session.")
class TradingSessionProvider {
    sessionStorage;
    getSession() {
        return this.sessionStorage.getTradingSession();
    }
    static create(sessionStorage) {
        let tradingSessionProvider;
        tradingSessionProvider = new TradingSessionProvider();
        tradingSessionProvider.sessionStorage = sessionStorage;
        return tradingSessionProvider;
    }
}
module.exports = TradingSessionProvider
